import React from "react";

export default function Results(props) {
  if (props.results) {
    return (
      <div className="Results">
        <p> You searched for {props.results.word} </p>;
        {props.results.meanings.map(function (meaning, index) {
          return <div key={index}></div>;
        })}
      </div>
    );
  } else {
    return null;
  }
}
